export const Contact = () => {
  return (
    <div id="contact" className="contact">
      <div className="container">
        <div className="contact-contents">
          <h2>Contact</h2>
          <p className="description">下記へお問い合せください。</p><br></br>
            <a href="https://twitter.com/TakeshiKobaya16" className="btn">こちらにDMにて対応します！</a>
        </div>
      </div>
    </div>
  );
}
